import React from "react"
export default class Call extends React.Component{
    callphone(){    
        window.location.href = "tel:10086";
    }
    render(){
        return(
            // <button onClick={this.callphone()}>10086</button>
            <a href={"tel:10086"}>10086</a>
        )
    }
}
